                self = REcmaHelper::scriptValueTo<RTextEntity >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RTextEntity.%1(): "
                        "This object is not a RTextEntity").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
